    float* array;
    int count;
};

struct OuterStruct {
    InnerStruct* inner;
    int num_inner;
};

cudaError_t allocateNestedStruct(OuterStruct** d_outer, const OuterStruct& h_outer) {
    cudaError_t err = cudaSuccess;

    // Allocate device outer struct
    err = cudaMalloc(d_outer, sizeof(OuterStruct));
    if (err != cudaSuccess) return err;

    // Allocate device array of inner structs
    InnerStruct* d_inner_array;
    err = cudaMalloc(&d_inner_array, h_outer.num_inner * sizeof(InnerStruct));
    if (err != cudaSuccess) {
        cudaFree(*d_outer);
        return err;
    }

    // For each inner struct, allocate its pointer data
    for (int i = 0; i < h_outer.num_inner; i++) {
        float* d_array;
        err = cudaMalloc(&d_array, h_outer.inner[i].count * sizeof(float));
        if (err != cudaSuccess) {
            // Cleanup previously allocated memory
