                        h_outer.inner[i].count * sizeof(float), cudaMemcpyHostToDevice);
        if (err != cudaSuccess) {
            cudaFree(d_array);
            for (int j = 0; j < i; j++) {
                cudaFree(d_inner_array[j].array);
            }
            cudaFree(d_inner_array);
            cudaFree(*d_outer);
            return err;
        }

        // Update inner struct with device pointer
        d_inner_array[i].array = d_array;
        d_inner_array[i].count = h_outer.inner[i].count;
    }

    // Update outer struct with device pointers
    OuterStruct temp_outer = h_outer;
    temp_outer.inner = d_inner_array;

    err = cudaMemcpy(*d_outer, &temp_outer, sizeof(OuterStruct), cudaMemcpyHostToDevice);

    return err;
}
```

